  return (
    <Fragment>
      <h1>Administrador de pacientes Veterinarios</h1>
      <div className="container">
        <div className="row">
          <div className="one-half column">
            <Formulario
              crearCitas = {crearCitas}
            />
          </div>
          <div className="one-half column">2</div>
        </div>
      </div>
    </Fragment>
  );
}

export default App;
